description:
bán nền đất nằm trong khu biệt thự, dự án long tân city, tại h.nhơn trạch, đồng nai. đây là dự án duy nhất có sổ trên mặt tiền đường 25c (đ.nguyễn ái quốc) nối cổng chính sân bay quốc tế long thành. - diện tích nền đất 500m2, ngang 17m. hình thức giao dịch hiện tại: khách mua giữ sổ và ký phụ lục hợp đồng mới với chủ đầu tư.
 
****** vị trí dự án cực tiềm năng:
 
- cách sân bay quốc tế long thành 15km;
 
- cách ubnd tp.thủ đức 17km;
 
- cách trung tâm hành chính huyện mới 1km;
 
- cách dự án thảo điền 3km;
 
- cách vành đai 3 3.5km;
 
- cách dự án kđt swan park 1km;
 
